var earthCountriesCenter = {};

for (let i of earthSmallCountries){
	let pos = {x: 0, y: 0};
	let num = 0;
	let bounds = {start: {}, end: {}};
	
	for (let arr of earthEntity.pos.arr[i][0]){
		num++;
		pos.x += arr.x;
		pos.y += arr.y;
		
		bounds.start.x = Math.min((bounds.start.x ?? arr.x), arr.x);
		bounds.start.y = Math.min((bounds.start.y ?? arr.y), arr.y);
		bounds.end.x = Math.max((bounds.end.x ?? arr.x), arr.x);
		bounds.end.y = Math.max((bounds.end.y ?? arr.y), arr.y);
	}
	
	let averagePos = {
		x: (pos.x / num) * 2 - 1,
		y: (pos.y / num) -0.4775
	};
	let middlePos = {
		x: (bounds.start.x + (bounds.end.x-bounds.start.x)/2) * 2 - 1,
		y: (bounds.start.y + (bounds.end.y-bounds.start.y)/2) -0.4775
	};
	
	earthCountriesCenter[i] = {
		x: (averagePos.x + middlePos.x) / 2,
		y: (averagePos.y + middlePos.y) / 2
	};
	earthCountriesCenter[i] = averagePos;
}
